import React from 'react'
import {  Header, Container, Icon } from 'semantic-ui-react'
import IconImages from './IconImages'

export default function Home() {
    return (
        <React.Fragment style={{top: 0}}>

            <IconImages/>
            <Header as='h3' textAlign='right' className="home my name">Guligena Aierken</Header>
            <Header as='h4' textAlign='right' className="home my job title ">Full Stack Developer | Software Engineer</Header>

        </React.Fragment>
    )
}
